-- ----------------------------
--  Table structure for `__bon_commande`
-- ----------------------------
DROP TABLE IF EXISTS `__bon_commande`;
CREATE TABLE `__bon_commande` (
  `id` smallint(5) unsigned NOT NULL auto_increment,
  `numero_commande` varchar(64) NOT NULL,
  `id_formation` smallint(5) unsigned NOT NULL,
  `id_budget` tinyint(3) unsigned NOT NULL,
  `montant` mediumint(8) unsigned NOT NULL,
  `observation` varchar(256) NOT NULL,
  `enregistre_le` datetime NOT NULL,
  `enregistre_par` varchar(128) NOT NULL,
  PRIMARY KEY  (`id`),
  UNIQUE KEY `id_formation` (`id_formation`,`id_budget`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='Bons de commande affectable aux formations';

