  `superieur_hierarchique` varchar(64) NOT NULL,
  `type_salarie` tinyint(4) NOT NULL default '1' COMMENT '1=>Salarié OCIT, 2=>Externe',
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

