-- ----------------------------
--  Table structure for `_personnel`
-- ----------------------------
DROP TABLE IF EXISTS `_personnel`;
CREATE TABLE `_personnel` (
  `id` smallint(5) unsigned NOT NULL auto_increment,
  `entite` tinyint(4) NOT NULL default '3' COMMENT '1=>OCI, 2=>CIT, 3=>CI2M',
  `direction` varchar(32) NOT NULL,
  `matricule` text NOT NULL,
  `nom` varchar(32) NOT NULL,
  `prenoms` varchar(64) NOT NULL,
  `genre` varchar(16) NOT NULL,
  `date_naissance` varchar(32) NOT NULL,
  `nationalite` varchar(32) NOT NULL,
  `fonction` varchar(256) NOT NULL,
  `categorie` varchar(12) NOT NULL,
  `date_embauche` varchar(24) NOT NULL,
  `cnps` varchar(64) NOT NULL,
  `superieur_hierarchique` varchar(64) NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

