  PRIMARY KEY  (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='Liste des formations OCIT';

-- ----------------------------
--  Records of `formation`
-- ----------------------------
BEGIN;
INSERT INTO `formation` VALUES ('1', 'Suivi et évaluation des projets', '- planifier le suivi et évaluation de projet,- élaborer des indicateurs de mesure de performance de projet- calculer des indices de performance des actions sur le terrain- préparer et conduire une mission d\'évaluation de projet sur le terrain', '15', '1', '2', '2', '1', '1', '1', '0000-00-00', ''), ('2', 'Formation des correspondants en métrologie', '* Suivre le recensement des appareils de mesure* Définir les seuils d\'alerte et évaluer périodiquement les mesures des appareils* Gérer le raccordement des appareils témoins* Mettre à jour les fiches de vie', '15', '1', '2', '1', '1', '0', '1', '0000-00-00', ''), ('3', 'Formation sur les livrables des modèles Volcano (Projet calibration)', '* Présenter la campagne de mesure effectuée en octobre 2012\r\n* Présenter les résultats  du calibrage des modèles volcano 3G\r\n* Faire des recommandations sur l\'application des modèles calibrés ', '10', '2', '2', '2', '1', '1', '1', '0000-00-00', ''), ('4', 'Je deviens manager d\'équipe (Groupe 1/ Dakar)', '*Faire vivre la charte de management Orange  à travers les pratiques managériales*Comprendre le management relationel et engageant*Développer ses collaborateurs par un management appréciatif*Maîtriser la communication: élément essentiel du management*Développer la responsabilité, prise d’initiative et l’autonomie*Développer la performance collective', '9', '1', '2', '3', '2', '1', '1', '0000-00-00', ''), ('5', 'Formation sur le SWING', '* Connaître l\'architecture du système de dépôt des abonnés\r\n* Connaître le processus de production et de gestion du SAV des clients radio Swing', '6', '2', '2', '1', '1', '0', '0', '0000-00-00', ''), ('6', 'Formation sur l\'application GAIA', '* Avoir une capacité d’utilisation avec aisance de l’application GAIA* Maitriser de la prise de commande.* Gérer le processus de provisionning et de facturation.paramétrer les offres commerciales* Etre capable de comprendre et de paramétrer le module financier.* Etre capable de comprendre et de paramétrer le module technique.', '1', '2', '2', '2', '1', '1', '1', '0000-00-00', ''), ('7', 'Formation sur le Référentiel Managérial Orange (RMO)', '* S’approprier le contenu du RMO : les 8 compétences et les 6 niveaux,\r\n* Mettre en pratique le RMO : savoir repérer les compétences  d’un collaborateur par l’observation et le questionnement,\r\n* Conduire un entretien de recherche de compétences :  les techniques de conduite d’entretien,  les questions à se poser pour repérer une compétence et/ou identifier un potentiel,\r\n* Déterminer le profil d’une personne en terme de compétences, performance et de potentiel.\r\n', '9', '1', '2', '2', '1', '1', '1', '0000-00-00', ''), ('8', 'Formation W4 & Phoenix', '* Connaître Phoenix\r\n* Manipuler le W4 & Phoenix\r\n* Maitriser et suivre les travaux  ', '1', '2', '2', '1', '1', '0', '1', '0000-00-00', ''), ('9', 'Formation Marketing Direct', '* Développer une stratégie Marketing Direct segmentée,\r\n* Définir les différents éléments du Plan Marketing Relationnel (PMR),\r\n* Définir le process et les acteurs du PMR,\r\n* Définir les composantes d’une campagne: cible, canal, proposition, moment,\r\n* Définir les composantes de la proposition (offre),\r\n* Adopter une approche test & learn,\r\n* Analyser le retour sur investissement des actions et de la politique en marketing direct.\r\n', '14', '3', '2', '2', '1', '1', '1', '0000-00-00', ''), ('11', 'Formation & Certification ITIL Foundation V3', '* Comprendre le réferentiel ITIL  v3 *  Maîtriser les éléments et concepts fondamentaux  de ITIL v3  * Comprendre les concepts de gestion des services IT basées sur ITILV3, édition 2011, et d’en acquérir le vocabulaire, * Maîtriser les éléments et concepts fondamentaux de ITIL v3 , * Connaître les principes fondamentaux des bonnes pratiques organisées autour du cycle de vie des services, * Appréhender les apports et les bénéfices à mettre en place les bonnes pratiques ITIL, * Maîtriser les phases du cycle de vie et les principaux processus associés', '10', '2', '2', '2', '1', '1', '1', '0000-00-00', ''), ('12', 'Je deviens manager de managers', 'S\'approprier les spécificités de la posture de manager de managers  **  Travailler concrètement sur vos nouveaux enjeux managériaux : donner du sens, déléguer, motiver, savoir soutenir et accompagner vos managers  ** Renforcer votre leadership en travaillant autour du « leadership situationnel » et de l’intelligence émotionnelle', '9', '1', '2', '3', '2', '1', '0', '0000-00-00', ''), ('13', 'Mieux communiquer en public', '* Avoir la technique pour mieux s\'exprimer  * Avoir confiance en soi lors de la prise de parole en public', '9', '1', '2', '3', '3', '1', '1', '0000-00-00', ''), ('14', 'Mieux communiquer : les fondamentaux', '* Maîtriser les outils fondamentaux de communication * Savoir utiliser les outils de communication dans un contexte professionnel', '9', '1', '2', '3', '3', '1', '1', '0000-00-00', ''), ('15', 'Conférence Internationale sur \"l\'Impact des Médias Sociaux sur les Organisations et les Entreprises\"', '* Aprrendre à élaborer une approche stratégique pour la gestion des médias sociaux *  Comprendre le rôle que joueront les médias sociaux dans votre entreprise ou organisation dans l\'avenir * Découvrir et comprendre les tendances et les challenges associés aux médias sociaux selon une approche structurée', '12', '3', '2', '3', '3', '1', '1', '0000-00-00', ''), ('16', 'Formation Ms Project 2010', '* Connaître les fonctions de bases de Microsoft Project 2010 * Appréhender la démarche méthodologique d\'utilisation d\'un logiciel de gestion de projet dans le contexte de projet Télécom', '10', '1', '2', '2', '1', '1', '1', '0000-00-00', ''), ('17', 'Méthodes et outils de suivi - evaluation des projets', '* Connaître le processus d\'élaboration d\'un dispositif de suivi-évaluation de projet  * * Maîtriser les techniques employées pour le suivi des indicateurs de coûts, de durée et de performance ** Connaître les exigences d\'une mission d\'évaluation de projet à tout moment de son cycle de vie', '10', '1', '2', '3', '1', '1', '1', '0000-00-00', ''), ('18', 'SDM Expert', '* Gérer la configuration matérielle et logicielle *  Gérer l\'interface et la configuration * Gérer les requêtes et les jobs *  Gérer les pilotes et les serveurs', '1', '2', '2', '2', '1', '1', '1', '0000-00-00', ''), ('19', 'Formation en management des membres du CODIR', '* Se connaître soi-même * Connaître son fonctionnement social * Avoir la maîtrise de soi * Maîtriser la communication managériale * Gérer le stress * Appréhender son champ lexical * Connaître le management humain', '13', '1', '2', '2', '1', '1', '-1', '0000-00-00', ''), ('20', 'Formation BSS B11', '* Description et maintenance 9100 BTS avec focus sur le RIC -TRX et MC-RRH * Description et maintenance 9130 BSC Evolution avec focus sur l\'introduction du SM11 * Description et maintenance 9125 TC', '1', '2', '2', '2', '1', '1', '1', '0000-00-00', ''), ('21', 'Formation des formateurs dans le cadre du projet \"EPERVIER\"', '* Initialiser et utiliser l\'application Epervier * Administrer la plateforme EXO de gestion centralisée * Simplifier le travail du chargé clientèle par l\'accès unique aux applications et par la recherche multicritères ', '3', '3', '2', '2', '1', '1', '1', '0000-00-00', ''), ('22', 'Formation des managers dans le cadre du \"Projet Epervier\"', '* Mieux appréhender l\'application \"Epervier\" * Etre un relais pour les chargés de la force de vente et leurs équipes * Amener les équipes à réduire le temps de travail', '3', '3', '2', '2', '1', '1', '1', '0000-00-00', ''), ('23', 'Formation JDE:  Gestion des Stocks (Les opérationnels)', '* Saisir ou prendre une Commande * Faire la facturation * Faire des Consultations sur l\'interface Zébra * Gérer & Contrôler le Risque Client * Faire des Sorties - Editions BL  * Faire des Opérations de stocks (receptions,mouvements de stock etc…) * Faire l\'Intégration comptable * Saisir et Suivre des Encaissements', '2', '1', '2', '2', '1', '1', '1', '0000-00-00', ''), ('24', 'Formation JDE: Gestion des Stocks (Les managers)', '* Saisir ou prendre une Commande * Faire la facturation * Faire des Consultations sur l\'interface Zébra * Gérer & Contrôler le Risque Client * Faire des Sorties - Editions BL * Faire des Opérations de stocks (receptions,mouvements de stock etc…) * Faire l\'Intégration comptable * Saisir et Suivre des Encaissements ', '2', '1', '2', '2', '1', '1', '1', '0000-00-00', ''), ('25', 'Formation à la Gestion des commandes avec l\'application JDE', '* Savoir saisir convenablement une demande d\'achat sans erreur, en respectant toutes les nouvelles étapes dans l\'application JDE', '2', '1', '2', '1', '1', '0', '1', '0000-00-00', ''), ('26', 'FC, Fondamentaux - Pilotage de la demande, des stocks et des flux', '* Introduire à la gestion des approvisionnements et des flux * Planifier les prévisions et la demande * Comprendre les fondamentaux de la gestion des flux et de l’approvisionnement (fonctionnalités, coûts, KPI) * Examiner des principaux modèles de management', '2', '1', '2', '3', '1', '1', '1', '0000-00-00', ''), ('27', 'FC, Fondamentaux - Logistique inversée et process après-vente', '* Introduire à la logistique inversée (les divers flux retours, pourquoi initialiser un flux retour) * Intérêt du service après-vente * Bases des stratégies de pilotage des flux retours et des process après-vente * Amélioration du service (axes de développement des affaires, leviers de process et zones d’optimisation) * Gestion du cycle de vie des produits et process associés (illustrations spécifiques sur la gestion de la garantie, les opportunités commerciales, la gestion de la fin de vie) * Compréhension des flux retour (process de collecte, business model) * Facteurs clés de succès en logistique inversée * Réglementation verte et ses impacts terrain * Sous-traitants et intégrateurs de solutions « logistique inversée »', '2', '1', '2', '3', '4', '1', '1', '0000-00-00', ''), ('28', 'Formation JDE : Gestion des approvisionnements', '* Expliquer le principe de base  de JDE * Saisir  et consulter les données d’une  commande * Faire la réception d’une commande * Faire la saisie  d’un retour de stock', '3', '3', '2', '1', '1', '0', '1', '0000-00-00', ''), ('29', 'Formation sur les produits  optiques (OMSN 1678 MCC  Rel. 4.6 : W16)', '* Décrire les fonctions et caractéristiques du 1678 MCC * Gérer les opérations et administrer le 1678 MCC * Faire les rélévés de performance * Connaître les éléments opérationnels du réseau * Gérer les alarmes', '1', '2', '2', '2', '1', '1', '1', '0000-00-00', ''), ('30', 'Formation sur les produits  optiques (WDM  1830 PSS- 36/32/16 R3.6.5: W22)', '* Decrire les caractéristiques et la structure du PSS * Identifier les applications en réseau de l\'équipement R.3.6.5 * Décrire la fonction et les connecteurs des cartes réseau * Identifier le câble electrique et optique de l\'équipement *  Analyser un service dans une application FODAM * Analyser les performances monitoring sur le Web-UI et 1354 RMPHM * Utiliser les fonctions backup et restore sur le Web-UI et 1354 RMPHM * Localiser et analyser les alarmes sur le Web-UI et 1354 RMPHM', '1', '2', '2', '2', '1', '1', '1', '0000-00-00', ''), ('31', 'Formation sur les produits  optiques (OMSN  1660SM O&M : W23)', '* Decrire les applications du 1660 SM * Decrire les méthodes de sup des OMSN * Decrire le rack et le sub-rack * Identifier les cartes et leurs fonctions * Configurer la communication et le routage * Créer la typologie du réseau et les protections * Exploiter l\'équipement 1660 SM à partir du 1320 CT', '1', '2', '2', '2', '1', '1', '1', '0000-00-00', ''), ('32', 'Formation pour la projet de fiabilisation des données GAIA', '* Connaître le projet FIABILYS et ses enjeux * Maîtriser le réseau et les mesures * Maîtriser les outils Fiabilys', '10', '2', '2', '2', '1', '1', '1', '0000-00-00', ''), ('33', 'Formation en législation du travail : droits et devoirs des représentants du personnel', '* Connaître leurs rôles et missions en tant que délégué du personnel * Maîtriser les droits et devoirs du délégué du personnel * Appréhender les moyens légaux nécessaires à leurs fonctions *  Avoir une parfaite connaissance des relations professionnelles en entreprise', '9', '1', '2', '2', '1', '1', '1', '0000-00-00', ''), ('34', 'Formation Managers & Trainers', '* S’approprier le mode de diffusion de la formation et de la redéployer aux auditeurs ', '9', '1', '2', '3', '3', '1', '1', '0000-00-00', ''), ('35', 'Formations the trainer pour les futurs Trainers', '• S’approprier et Animer les actions de formation • Faciliter les apprentissages •	Appliquer strictement les consignes de Orange Campus • Accompagner le parcours de formation de chaque auditeur', '9', '1', '2', '3', '3', '1', '1', '0000-00-00', ''), ('36', 'Maîtriser de l’évaluation des marchandises en douane pour faire face aux redressements de valeur', '* Maîtriser les règles de détermination de la valeur en douane ; * Evaluer convenablement l’assiette imposable des marchandises ; * Se familiariser avec les différentes méthodes d’évaluation ; * Maîtriser le recours devant le Comité d’Arbitrage de la Valeur.', '2', '1', '2', '3', '1', '1', '1', '0000-00-00', ''), ('37', 'MOTIVER ET IMPLIQUER', '* Accroître les facteurs motivants et faire la chasse aux facteurs démotivants', '9', '1', '2', '3', '3', '1', '1', '0000-00-00', ''), ('38', 'METHODES ET OUTILS DE SUIVI-EVALUATION DE PROJETS', '* Avoir une connaissance approfondie du processus d\'élaboration d\'un dispositif de suivi-évaluation de projet dans la dynamique du management des projets * Avoir une parfaite des techniques employées pour le suivi des indicateurs de coûts, de durée et de performances par une simulation de cas réels et des exercices d\'illustratifs * Avoir une bonne connaissance des exigences d\'une mission d\'évaluation de projet à tout moment de son cycle de vie ', '10', '1', '2', '3', '1', '1', '1', '0000-00-00', ''), ('39', 'Huawei NE40E series router training', '• Décrire l’architecture système du routeur NE40 • Comparer les configurations des routeurs Cisco à celles des routeurs Huawei  • Maitriser les commandes de configuration du routeur NE40 •	Implémenter des configurations de routages dynamiques sur un routeur NE40 • Etre capable de transcrire les configurations d’un routeur Cisco vers un routeur Huawei', '10', '2', '2', '2', '1', '1', '1', '0000-00-00', ''), ('40', 'Je deviens manager d\'équipe (Groupe 2 / Dakar)', '* Faire vivre la charte de management Orange à travers les pratiques managériales * Comprendre le management relationel et engageant * Développer ses collaborateurs par un management appréciatif * Maîtriser la communication: élément essentiel du management * Développer la responsabilité, prise d’initiative et l’autonomie * Développer la performance collective ', '9', '1', '2', '2', '3', '1', '0', '0000-00-00', ''), ('41', 'Formation Maintenance Câble terreste ACE à Brest ( France)', '* Connaitre les généralités sur la maintenance des câbles terrestres de type sous marin *  Savoir localiser des défauts électriques et optiques sur le parcours térrestre (câble sous-marin et chambres de plage) *  Connaître les différentes technologies de raccordement terrestre *  Faire le jointage de câbles', '1', '2', '2', '2', '2', '1', '1', '0000-00-00', ''), ('42', 'WORD', 'utykhlhkoih;lgh', '9', '1', '2', '2', '1', '1', '0', '0000-00-00', ''), ('43', 'Formation Synergy (Professionnalisation des Chefs de projets)', '* Comprendre le rôle de Chef de projet et la méthodologie de pilotage de projet (harmoniser les bases et le vocabulaire des Chef de projet OCIT)', '10', '1', '2', '2', '1', '1', '1', '0000-00-00', '');
COMMIT;

